●鼻の外側にジェルを塗るだけ。<br>
●眠くならない。<br>
●化粧の上から使える。<br><br>

【使用方法】<br>
1.チューブの中のジェルを１滴（ゴマ粒大）人差し指に取って下さい。<br>
2.人差し指に取ったジェルを、親指を使って指の上で広げて下さい。<br>
3.指で広げた後、鼻孔の周りや鼻と上唇部の間にジェルの薄い膜を作るように塗って下さい。<br><br>

【ご注意】<br>
○1日に3～4回を目安にご使用下さい。<br>
○汗、鼻をかむ、指で触る等でジェルが取れることがありますので、その際は塗りなおして下さい。<br>
○花粉が飛散する前からのご使用をおすすめします。<br>
○ご使用前に鼻の周囲の花粉等を取り除き、清潔にしてからご使用頂くと効果的です。また、ご使用の際には清潔な手でご使用下さい。<br><br>

【成分】<br>
水溶性陽電荷帯電ポリマー他<br><br>

【内容量】<br>
3g<br><br>

【販売元】<br>
エーザイ株式会社<br>
お問い合わせ先：0120-161-454<br><br>

【商品区分】<br>
衛生医療<br><br>

［クリスタルベール/花粉対策/花粉ブロック/イオンのチカラ］

